import React from "react";
import Exams from "./Exams";
import Users from "./Users";
class Navbar extends React.Component {
  render() {
    return (
      <>
        <div>
          <Exams />
        </div>
        <div>
          <Users />
        </div>
      </>
    );
  }
}
export default Navbar;
